void write_pixel(int x, int y, short colour) {
  volatile short *vga_addr=(volatile short*)(0x08000000 + (y<<10) + (x<<1));
  *vga_addr=colour;
}

int switch_value(){
	volatile int *decimal = (volatile int *)0xFF200040;
	int k = *decimal;
	if(k == 512)
		return 9;
	if(k == 256)
		return 8;
	if(k == 128)
		return 7;
	if(k == 64)
		return 6;
	if(k == 32)
		return 5;
	if(k == 16)
		return 4;
	if(k == 8)
		return 3;
	if(k == 4)
		return 2;
	if(k == 2)
		return 1;
	if(k == 1)
		return 0;
	return 11;
}

