// Function to check if tubes are sorted
int is_sorted() {
    for (int i = 0; i < NUM_BOTTLES; i++) {
        int prev_color = bottles[i][0];
        for (int j = 1; j < MAX_TUBE_HEIGHT; j++) {
                if (bottles[i][j] != prev_color) {
                    return 0;
                }
        }
    }
	printf("sorted");
    return 1;
}

// Function to generate random colors for bottles
void generate_colors() {
    // Generate different colors for each bottle
    for (int i = 0; i < 3; i++) {
        // Fill the bottle with the chosen color
        for (int j = 0; j < MAX_TUBE_HEIGHT; j++) {
            bottles[i][j] = i+1;
        }
    }
}

// Function to print bottles with liquids
void print_bottles() {
	 printf("Bottles:\n");
    for (int i = 0; i < NUM_BOTTLES; i++) {
        printf("Bottle %d:", i + 1);
        for (int j = 0; j < MAX_TUBE_HEIGHT; j++) {
            printf(" %d", bottles[i][j]);
        }
        printf("\n");
    }
    int colour[4]={2088,16740000,13950000,12020000};
	int space = (320 - 35* NUM_BOTTLES)/(NUM_BOTTLES+1);
	int x= space,y1=38,y2=175;
	for(int i=0; i<NUM_BOTTLES; i++)
	{
			for(int y=y1;y<y2;y++)
			{
				write_pixel(x,y,65535);
				write_pixel(x+35,y,65535);
			}
			for(int x1=x;x1<=x+35;x1++)
			{
				write_pixel(x1,175,65535);
			}
		x=x+space+35;
	}
	for(int i=0; i<NUM_BOTTLES; i++)
	{
		for(int j=0;j<MAX_TUBE_HEIGHT;j++)
		{
			for(int y=j*27+40; y<j*27+67; y++)
				for(x = space*(i+1)+ 35*i+1; x< (space+35)*(i+1); x++)
					write_pixel(x,y,colour[bottles[i][j]]);
		}
	}
}

// Function to move liquid from source tube to destination tube
int move_liquid(int source, int destination, int flag) {
    int source_empty = 1; // Flag to track if the source tube is empty
    // Check if the source tube is empty
    for (int j = MAX_TUBE_HEIGHT - 1; j >= 0; j--) {
        if (bottles[source][j] != 0) {
            source_empty = 0;
            break;
        }
    }
    if (source_empty) {
        return 1;
    }

    int i,j;
    for( j = 0; j< MAX_TUBE_HEIGHT; j++){
        if(bottles[source][j] != 0)
            break;
    }
    for( i = 0; i< MAX_TUBE_HEIGHT; i++){
        if(bottles[destination][i]!=0)
            break;
    }
    //destination full
    if(i==0)
    {
        return 2;
    }
    if(j==MAX_TUBE_HEIGHT)
    {
        return 1;
    }
    i--;
    if(i==MAX_TUBE_HEIGHT-1) 
    {   
        bottles[destination][i]= bottles[source][j];
        bottles[source][j]=0;
        return 0;
    }
    else if(bottles[destination][i+1]==bottles[source][j]||flag)
    {
        bottles[destination][i]= bottles[source][j];
        bottles[source][j]=0;
        return 0;
    }
    else
        return 3;//colour not same
}

// Function to randomly swap liquids between all 5 bottles
void random_swap() {
    // Perform multiple random swaps
    //int num_swaps = rand()%(10*NUM_BOTTLES* MAX_TUBE_HEIGHT) ; // Random number of swaps
    int num_swaps = 1000;
	//int num_swaps = rand();
	printf("%d",num_swaps);
    for (int i = 0; i < num_swaps; i++) {
        int source = rand() % NUM_BOTTLES;
        int destination = rand() % NUM_BOTTLES;
        while (source == destination || !move_liquid(source, destination,0)) {
            destination = rand() % NUM_BOTTLES;
            
        }
    }
     printf("Successfully swapped");
}

void puzzle_generation() {
    // Generate 3 full bottles with different color liquids
    generate_colors();
    // Generate 2 empty bottles
    for (int i = 3; i < NUM_BOTTLES; i++) {
        for (int j = 0; j < MAX_TUBE_HEIGHT; j++) {
            bottles[i][j] = 0; // Empty bottle
        }
    }
    // Print the bottles
    //print_bottles();
    random_swap();
    // Print the bottles after swapping
    //print_bottles();
    for(int i=3; i< NUM_BOTTLES; i++)
    {
        while(bottles[i][MAX_TUBE_HEIGHT-1]!=0)
        {
            for(int j = 0; j<3; j++)
            {
                if(move_liquid(i,j,1)==1)
                    break;
            }
        }
    }
    print_bottles();
}

