void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
  *character_buffer = c;
}

// use write_pixel to set entire screen to black (does not clear the character buffer) 
void clear_screen() {
  int x, y;
  for (x = 0; x < 320; x++) {
    for (y = 0; y < 240; y++) {
	  write_pixel(x,y,0);
	}
  }
	for(x =0 ;x<80; x++)
	{
		for(y=0; y<60; y++)
			write_char(x,y, ' ');
	}
}

void display_page(int page[240][320])
{
	for(int i=0;i<=239;i++)
	{
		for(int j =0; j<=319; j++)
			write_pixel(j,i, page[i][j]);
	}
}
